Vue.component("dynamic", {
    props: {
        string: {
            required: !0,
            type: String
        }
    },
    data: function() {
        return {
        }
    },
    render(h) {
        const self = this,
            render = {
                template: "<div>" + this.string + "</div>"
            };
        return h(render)
    }
});

var dynamic1 = {
    props: {
      template: {
          required: !0,
          type: String
      },
    },
    data: () => ({
      templateRender: null,
    }),
    render(h) {
      if (!this.template) {
        return h('div', 'loading...');
      } else { // If there is a template, I'll show it
        return h(Vue.component('dynamic-render', {
          template: this.template
        }));
      }
    },
  }